
List<String> input2 = """     |          
     |  +--+    
     A  |  C    
 F---|----E|--+ 
     |  |  |  D 
     +B-+  +--+ """.split('\n');

List<List<String>> rows = new List<List<String>>();
String phrase = '';

main() {
  for (var splitRow in input) {
    List<String> row = new List<String>();
    for (var splitCol in splitRow.split('')) {
      row.add(splitCol);
    }
    rows.add(row);
  } 
  
  var firstRow = input[0].split('');
  int col = 0;
  for (var start in firstRow) {
    if (start == '|') {
      col = firstRow.indexOf(start);
      
    }
  }

  go(0, col, 's');

  print(phrase);
}

go(x, y, direction) {
  String step = '';
  

  bool pathing = true;

  while(pathing) {
    print('$x, $y');
    step = rows[x][y];

    switch(step) {
      case '|':
        if (direction == 's') {
          if (rows[x + 1][y] == '-') {
            x += 2;
          } else {
            x += 1;
          }
        } else if (direction == 'n') {
          if (rows[x - 1][y] == '-') {
            x -= 2;
          } else {
            x -= 1;
          }
        } else if (direction == 'e') {
          y += 1;
        } else if (direction == 'w') {
          y -= 1;
        }
        break;
      case '-':
        if (direction == 'e') {
          if (rows[x][y + 1] == '|') {
            y += 2;
          } else {
            y += 1;
          }
        } else if (direction == 'w') {
          if (rows[x][y - 1] == '|') {
            y -= 2;
          } else {
            y -= 1;
          }
        } else if (direction == 'n') {
          x -= 1;
        } else if (direction == 's') {
          x += 1;
        }
        
        break;
      case '+':
        if (x - 1 > 0 && rows[x - 1][y] != ' ' && direction != 's') {
          direction = 'n';
          x -= 1;
        } else if (rows.length > x + 1 && rows[x + 1][y] != ' ' && direction != 'n') {
          direction = 's';
          x += 1;
        } else if (rows[x].length > y + 1 && rows[x][y + 1] != ' ' && direction != 'w') {
          direction = 'e';
          y += 1;
        }else if (y - 1 > 0 && rows[x][y - 1] != ' ' && direction != 'e') {
          direction = 'w';
          y -= 1;
        }
        break;
      case ' ':
        print('all done pathing');
        pathing = false;
        break;
      default:
        phrase += step;
        print(step);
        if (direction == 'n') {
          x -= 1;
        } else if (direction == 's') {
          x += 1;
        } else if (direction == 'e') {
          y += 1;
        } else if (direction == 'w') {
          y -= 1;
        }
        break;
    }
  }
  
}


